function update() {
    module('lib.Bibtex').load(true);
    var webR = new WebResource(this.get('URL').textString);
    webR.get();
    var parser = new lib.Bibtex.BibtexParser();

    // this.get('BibtexSource').textString = webR.content
    // var content =  this.get('BibtexSource').textString
    var content =  webR.content
    parser.setInput(content);
    try {
        parser.bibtex()
    } catch(e) {
        alertOK("Bibtex Parsing Error: " + e)
    }
    var display = new lib.Bibtex.BibtexDisplay()

    this.entries = parser.getEntries();

    this.get('Bibliography').textString = Properties.own(this.entries)
        .sort().collect(function(ea) {
            var entry =this.entries[ea];
                return '' +ea +':\n    ' 
                + display.fixValue(entry.Author) + '. ' + entry.Year + '.\n    ' 
                + display.fixValue(entry.Title)
    }, this).join('\n')
}

